import React, {useState,useEffect} from 'react';
import AgentsCard from './AgentsCard'
import "./agents.css"

function Agents () {
    const [agents, setAgents] = useState([])

    useEffect(() => {
        fetch("http://localhost:3000/employees")
        .then((response) => response.json())
        .then((data) => {
          console.log(data);
          setAgents(data);
      });
    }, []);

  return (
        <ul className = "cards">
            {agents.map((agent) =>{
                return <
                    AgentsCard
                    key= {agent.name}
                    agent={ agent}
                />
            })}
        </ul>
    );
}

export default Agents;
